#nullable enable
namespace Xactika.Resources;
public static class SvgPngImageResource
{
    private readonly static string _cone = "data:image/svg+xml;base64,";
    public static string Cone => "Cone.svg";
    private readonly static string _cube = "data:image/svg+xml;base64,";
    public static string Cube => "Cube.svg";
    public static void Register()
    {
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("Cone.svg", _cone);
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("Cube.svg", _cube);
    }
}